chapter2/Ex2_10.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 < 0.9.0;

contract Ex2_10 {

    struct Market {
        string itemName;
        uint price;
    }

    Market[] openMarket;

    function sell(string memory _itemName, uint _price) public {
        openMarket.push(Market(_itemName, _price));
    }

    function search(string memory _itemName) public view returns(uint) {
        for(uint i = 0; i < openMarket.length; i++) {
            if(keccak256(bytes(openMarket[i].itemName)) == keccak256(bytes(_itemName))) {
                return openMarket[i].price;
            }
        }
    }


}

